  input: 'TEXT,F3XA,,"In response to your letter of January 30, 2002 regarding your
    review of the above referenced report, we have filed an amended report, and offer
    the following explanations:  Schedule D has been corrected in amendment.  We are
    also filing an amended report for the period 11/28/00-12/31/00 (paper filed -
    therefore paper amendment sent under separate cover)  The amendment was necessary
    to correct the beginning balances, specifically Andrew Woodson.  Clerical error
    at end of December showed him with a balance owed..  He had actually been paid
    with a manual check, and therefore there should have been a zero balance.  All
    occupation and employer information that we have been able to obtain for itemized
    contributors are in the amended report.  We routinely include in our solicitations
    for contribution, requests for contributor information and an explanation of the
    federal law requirements for reporting the same.  Our normal follow-up procedure
    is to call (if local) the contributor to request the missing information.  If
    unable to call, we send a letter to the contributor with a response section and
    a business reply envelope to return it in."'
